class Solution {
    int getProduct(vector<int>& nums, int size){    
        int product = 1;
        int currentIndex = size;        
        int numSize = nums.size();

        cout << "Nums size: " << numSize << endl;
        cout << "Array size: " << size << endl;

        // nums = [0, 4, 0]
        // res  = [0, 0, 0]
        // Iteration 1: [1] * [2]    4 * 0 = 0
        // Iteration 2: [0] * [2]    0 * 0 = 0
        // Iteration 3: [0] * [1]    0 * 4 = 0
        
        // Pass in the size of the vector (2) which would be numIndex (2)
        // [0] 
        // Current iteration would be [0] * [2] * [3]                      
        // which means it's going to add a 3 which means that current index would be 
        // 


        cout << "Skipping index: " << size << "   value: " << nums[currentIndex] << endl;

        if (numSize == 2){
            cout << "Inside numSize" << endl;
            return (size == 0) ? nums[1] : nums[0];
        }

        cout << "Product: " << product << endl;
        return product;

        // Always start at beginning
        for (uint16_t i = 0; i < nums.size(); i++){
            if (i == currentIndex || currentIndex == 0){
                product *= 1;
            } else {
                product *= nums[i];    
            }
        }
        cout << "Total: " << product << endl;

        return product;
    }

public:
//  nums = [1,2,3,4]
//         [24,12,8,6]

// nums = [-1,1,0,-3,3]
// exp  = [0,0,9,0,0]
    vector<int> productExceptSelf(vector<int>& nums) {
        vector<int> result;
        uint16_t leftLow = nums[0];
        uint16_t leftHigh = 0;
        
        uint16_t rightLow = 0;
        uint16_t rightHigh = nums.size() - 1;
        bool isFinished;

        int product = 1;
        int leftProduct = 1;
        int rightProduct = 1;

        cout << "01" << endl;

        if (nums.size() == 2){
            result.push_back(nums[1]);
            result.push_back(nums[0]);
            cout << "02a" << endl;
            return result;
        }

        // Everytime the index moves -- calculate left side * right side

        // Get the first number
        for (uint16_t z = 1; z < nums.size(); z++){                                
            product *= nums[z];
        }
        result.push_back(product);
        cout << "02b" << endl;
            
        // Get the rest of the numbers
        for (uint16_t i = 1; i < nums.size(); i++){            
            product = 1;
           
            // Get the last number
            if (i == nums.size() - 1){
                cout << "Calculating last number: " << endl;
                for (uint16_t j = 0; j < nums.size() - 1; j++){                    
                    
                    product *= nums[j];
                }                
                cout << "Last Number: " << product << endl;
                result.push_back(product);
                isFinished = true;                
            }

            if (isFinished){
                cout << "Leaving Loop" << endl;
                break;
            }

            // i = index
            // j = iteration

            // Case 0:     n 100
            // i = 1;
            // leftLow      = [0]
            // leftHigh     = [0]
            // rightLow     = i + 1 -> [1] + 1 = [2]
            // rightHigh    = [100]

            // Case 1:     n 100
            // i = 50;
            // leftLow      = [0]
            // leftHigh     = i - 1 = [49]
            // rightLow     = i + 1 -> [1] + 1 = [2]
            // rightHigh    = [100]
            for (uint16_t j = 0; j < nums.size(); j++){                                        
                if (j == 0){
                    leftLow = 0;
                }
                leftHigh = i - 1;
                rightLow = i + 1;                    
                
                cout << "Current index: " << i << endl;
                printf("Calculating left : [%d]-[%d]", leftLow, leftHigh);
                printf("Calculating right: [%d]-[%d]", rightLow, rightHigh);
                // calculate 0 to index -1
                // calculate index + 1 to last index
                while(leftLow < i){
                    leftProduct *= nums[leftLow];
                    leftLow++;
                }

                while(leftLow != rightHigh){
                    rightProduct *= nums[rightLow];
                    rightLow++;
                }
                product = leftProduct * rightProduct;
                cout << leftProduct << " x " << rightProduct << " = " << product << endl;
            }
            
            result.push_back(product);
            
        }
        
        
        return result;
    }
};


